      <a>News link</a>
    </Link>
  </Layout>
);

Index.getInitialProps = async function (context, agent) {
  const { store } = context;
  console.log(agent)
  if (!process.browser) {
    await store.dispatch(getConfig(context.req));
  }

  return {};
};

export default Index;
